// MainSection.js
import React from 'react';
import Buttons from './MainContent/Buttons/Buttons'; // Import your Buttons component
import MainImage from './MainContent/MainImage';

const MainSection = () => {
  return (
    <div>
      <MainImage src="./girl.png" />
      <nav>
        <Buttons to="/archive" text="Archive" />
        <Buttons to="/news" text="News" />
        <Buttons to="/documents" text="Documents" />
      </nav>
    </div>
  );
};

export default MainSection;
